4.Description:
เมื่อ <color=#FFFFFF>[สกิลพิเศษ-EX]</color> ถูกศัตรู
CRIT Rate ของท่าจะเพิ่มขึ้นตามระยะห่างระหว่างตัวเอง และเป้าหมาย;
ยิ่ง Billy อยู่ใกล้เป้าหมาย เอฟเฟกต์ที่เพิ่มก็จะยิ่งเด่นชัด (เพิ่มได้สูงสุด 32%)

108100001.Description:
กด <IconMap:Icon_Normal> เพื่อ
ใช้ Pierce ใส่ศัตรูด้านหน้า เพื่อสร้าง<color=#F0D12B>ความเสียหายกายภาพ</color>;
เมื่อกดต่อเนื่อง หรือกดค้างจะสามารถเข้าสู่ท่าคุกเข่ายิง และยืดระยะเวลาการยิงต่อเนื่องให้นานขึ้น;
เมื่อลาก{LAYOUT_CONSOLECONTROLLER#จอยสติ๊ก}{LAYOUT_FALLBACK#จอยสติ๊ก}ในระหว่างคุกเข่ายิง จะสามารถกลิ้งยิงได้ ซึ่งจะขยับตำแหน่ง และสร้าง<color=#F0D12B>ความเสียหายกายภาพ</color>;
ในระหว่างคุกเข่ายิง เมื่อหยุดการกดต่อเนื่อง หรือปล่อยมือจากการกดค้าง จะยิงปิดฉากใส่ศัตรูด้านหน้า และสร้าง<color=#F0D12B>ความเสียหายกายภาพ</color>

108100004.Description:
กด <IconMap:Icon_Evade> เพื่อ
พุ่งหลบอย่างรวดเร็ว;
ขณะที่ใช้ท่านี้ จะมีเอฟเฟกต์ Invulnerable

108100011.Description:
เมื่อตัวละครที่อยู่ในสนาม กำลังจะถูกโจมตี กด <IconMap:Icon_Switch> เพื่อ
หลบการโจมตีของศัตรู และใช้ <color=#FFFFFF>[มุมมองสัมบูรณ์]</color>;
ขณะที่ใช้ท่านี้ จะมีเอฟเฟกต์ Invulnerable

108100012.Description:
หลังจากใช้ <color=#FFFFFF>[ซัปพอร์ตเมื่อหลบหลีก]</color> กด <IconMap:Icon_Normal> เพื่อ
ใช้ Pierce ใส่ศัตรูที่อยู่ข้างหน้าในพื้นที่วงกว้าง เพื่อสร้าง<color=#F0D12B>ความเสียหายกายภาพ</color>;
ขณะที่ใช้ท่านี้ จะมีเอฟเฟกต์ Invulnerable
